import './Tours.css'
import Tour from "./tour/Tour.js";


import React from "react";


const Tours = ({ tours }) => {
    return (
      <>
        {tours.map(tour => (
          <Tour key={tour.id} tour={tour} />
        ))}
      </>
    );
  };
  export default Tours;
